import React from 'react';

const SignIn = ({ handleSubmit, handleSignUp }) => {
    const userRef = React.useRef();
    const passRef = React.useRef();

    const onSubmitClick = () => {
        handleSubmit(userRef.current.value, passRef.current.value);
    }

    const onSignUpClick = () => {
        handleSignUp(userRef.current.value, passRef.current.value);
    }

    return (
        <div style={{ border:"1px solid black", borderRadius: '5px', margin: '10px', flex: 1 }}>
            <input ref={userRef} placeholder="email"/>
            <input ref={passRef} placeholder="password"/>
            <button onClick={onSubmitClick}>Submit</button>
            <button onClick={onSignUpClick}>Sign Up</button>
        </div>
    );
}

export default SignIn;
